import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = ({ isLoggedIn, username }) => {
  return (
    <nav className="bg-primary p-4 shadow-md">
      <div className="container mx-auto flex justify-between items-center">
        <div className="flex space-x-4">
          {isLoggedIn && (
            <>
              <Link to={`/users/${username}`} className="text-white hover:text-secondary transition-all">
                My Profile
              </Link>
              <Link to="/account-settings" className="text-white hover:text-secondary transition-all">
                Account Settings
              </Link>
              <Link to="/logout" className="text-white hover:text-secondary transition-all">
                Logout
              </Link>
            </>
          )}
          {!isLoggedIn && (
            <>
              <Link to="/login" className="text-white hover:text-secondary transition-all">
                Login
              </Link>
              <Link to="/register" className="text-white hover:text-secondary transition-all">
                Register
              </Link>
            </>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
